import React from "react";
import TextField from "@mui/material/TextField";

const Wallet = () => {
  return (
    <div>
      <h1>Wallet</h1>
      <TextField
        id="outlined-basic"
        label="Wallet"
        variant="outlined"
        placeholder="Your wallet name?"
      />
    </div>
  );
};

export default Wallet;
